import { logDOM } from '@testing-library/react';
import React from 'react';
import '../stylesheets/App.scss';
import logo from '../images/ogo.png'

class Header extends React.Component {
  render() {
    return (
      <>
      <header>
      <h1><img src={logo}/></h1>
      </header>
      </>
    );
  }
}

export default Header;
